@mbalachandar while this patch does prevent go routines from deadlocking on a bad mutex, it doesn't fully solve the problem.  The copy of the Entry struct results in the two Entry objects sharing a single instance of the ChildSchema map but using two different Mutex objects to protect access to it.  This can lead to "concurrent map read and map write" errors.

I will change this patch to move move all these objects (ChildSchema, ChildSchemaMutex, IsSchemaValidated) into a new struct, then add a pointer to that struct into the Entry object, and then ensure each Entry created initializes this struct.  The copy operation on the Entry operation will then result in both Entry objects sharing the same ChildSchema map and mutex which is safe.

This change looks simple enough, but since these errors are rare timing events I'll let it run in our tests for a few days.  If that doesn't show any problems I'll update this PR, probably towards end of this week.  If you feel there is a better way to address this issue than switching to a pointer in the Entry struct feel free to let me know.
